import React from "react";
import "./post.css";
import { BrowserRouter, Route, Link } from 'react-router-dom'


class Post extends React.Component{
  constructor() {
    super()
    this.state = {
      tasks: [
        {
          id: 1,
          body: "とりあえず表示してみる"
        },
        {
          id: 2,
          body: "私たち、いずれ書き換えられる運命"
        }
      ]
    }
  }

  render() {
    return (
      <div>
      <BrowserRouter>
      <li className="header-logo"><Link to='/login'>GLINE</Link></li>
      </BrowserRouter>

      <div className="App">
        <div className="tasks">
        {
          this.state.tasks.map( task => {
              return <div className="task" key={ task.id }>{ task.body }</div>
          })
        }
        </div>
      </div>
      </div>
    );
  }
}

export default Post;
